import React from 'react';
import './styles.css'

class LoginForm extends React.Component {

  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div className='main'>
        <header className='style-header'>Login</header>
        <input placeholder='Username' className='input-username input-basic'></input>
        <input type={'password'} placeholder='Password' className='input-password input-basic'></input>
      </div>
    )
  }
}

export default LoginForm;
